import React from 'react';

const OrderSuccess = () => {
  return (
    <div className="container mt-5">
      <h2>Narudžba Završena</h2>
      <p>Hvala što ste naručili. Vaša narudžba je uspješno zaprimljena i uskoro će biti poslana.</p>
    </div>
  );
};

export default OrderSuccess;
